export default {
    title: 'Scenes-App/Web Performance',
    parameters: { layout: 'fullscreen', options: { showPanel: false }, viewMode: 'canvas' },
    decorators: [
        mswDecorator({
            get: {
                '/api/projects/:projectId/events': {
                    results: eventsResponse,
                },
            },
        }),
    ],
} as Meta

